    root: {
        flexGrow: 1,
      },
    fieldstyle:{
        height: "10%",

    }
}));

export default function UserInfoPage() {
    const classes = useStyles();
  return (
    <React.Fragment>
         <Grid container spacing="3" justify ="center" >
            <Grid item xs= {6}>
              {/* ADD BACKGOUND */}
            </Grid>
            <Grid item xs= {6}>
